'use strict';

var lastKey = {UD: 1, LR: 1};
var keyMap = [
    [1,2,3],
    [4,5,6],
    [7,8,9]
]
var sequence = '';

var input = [
    '',
    '',
    '',
    '',
    ''
]

function runRow(directions) {
  for (var i = 0; i < directions.length; i++) {
    var direction = directions[i];
    if (direction == 'R') {
      if(lastKey.LR < 2) {
        lastKey.LR += 1;
      }
    }
    else if (direction == 'D') {
      if(lastKey.UD < 2) {
        lastKey.UD += 1;
      }
    }
    else if (direction == 'L') {
      if(lastKey.LR > 0) {
        lastKey.LR -= 1;
      }
    }
    else if (direction == 'U') {
      if(lastKey.UD > 0) {
        lastKey.UD -= 1;
      }
    }
  }
  sequence += keyMap[lastKey.UD][lastKey.LR]
}

input.forEach(runRow);

console.log(sequence);
